import React, { useState, useEffect } from 'react';
import axios from 'axios';
import UserNavbar from "../../components/UserNavbar/UserNavbar";
import '../Setting/Setting.css';

const Setting = () => {
    const [userInfo, setUserInfo] = useState(null);
    const [currentDate, setCurrentDate] = useState('');

    // API로부터 사용자 정보 불러오기
    useEffect(() => {
        const fetchUserInfo = async () => {
            try {
                const storedUserInfo = JSON.parse(sessionStorage.getItem('user'));
                if (storedUserInfo) {
                    const username = storedUserInfo.username; // localStorage에서 가져온 username
                    const response = await axios.get(`/my/${username}`);
                    setUserInfo(response.data); // API로 받은 사용자 정보를 상태로 설정
                } else {
                    console.log("사용자 정보가 없습니다.");
                }
            } catch (error) {
                console.error("사용자 정보 불러오기 실패:", error);
            }
        };

        fetchUserInfo();

        // 현재 날짜 설정
        const now = new Date();
        const formattedDate = now.toLocaleString('ko-KR', {
            year: 'numeric',
            month: '2-digit',
            day: '2-digit',
            hour: '2-digit',
            minute: '2-digit',
        });
        setCurrentDate(formattedDate);
    }, []);

    // 사용자 정보가 로드되지 않았을 때 로딩 표시
    if (!userInfo) {
        return <div>로딩 중...</div>;
    }

    return (
        <div className="Setting-page">
            <UserNavbar/>
            <div className="Setting-page-container">
                <div className="Setting-page-container-section">
                    <div className="Setting-page-container-User-img">
                        <img src={userInfo.profileImage || "기본 이미지 URL"} alt="프로필 이미지" />
                    </div>
                    <div className="Setting-page-container-User-imgchange">
                        프로필 변경하기
                    </div>
                    <div className="Setting-page-User">사용자 정보 </div>

                    <form>
                        <div className="Setting-page-form-div">
                            <p className="Setting-page-file">이름</p>
                            <input type="text" value={userInfo.name} readOnly />
                        </div>

                        <div className="Setting-page-form-div">
                            <p className="Setting-page-file">이메일</p>
                            <input type="text" value={userInfo.email} readOnly />
                        </div>

                        <div className="Setting-page-form-div">
                            <p className="Setting-page-file">아이디</p>
                            <input type="text" value={userInfo.username} readOnly />
                        </div>

                        <div className="Setting-page-form-div">
                            <p className="Setting-page-file">비밀번호</p>
                            <input type="password" value="********" readOnly />
                        </div>
                    </form>
                </div>
            </div>

            <div className="Setting-page-side">
                <div className='Setting-page-side-container'>
                    <div className="Setting-page-side-title">활동 정보</div>

                    <div className="Setting-page-side-section">
                        <div className="Setting-page-side-signupDate">가입일
                            <div className="Setting-page-side-signipDate-value">{userInfo.signupDate || currentDate}</div>
                        </div>

                        <div className="updateDate">최신 업데이트일
                            <div className='Setting-page-side-updateDate-value'>{userInfo.lastUpdated || currentDate}</div>
                        </div>
                    </div>

                    <div className='Setting-page-side-writtenBy'>
                        <div className='Setting-page-side-writtenBy-title'>작성</div>
                        <div className='Setting-page-side-writteBy-article'>게시글 수: {userInfo.articleCount || 0}</div>
                        <div className='Setting-page-side-writteBy-comment'>댓글 수: {userInfo.commentCount || 0}</div>
                        <div className='Setting-page-side-writteBy-inquiry'>문의 수: {userInfo.inquiryCount || 0}</div>
                    </div>
                </div>
                <div className='Setting-page-side-bottom'></div>
            </div>
        </div>
    );
};

export default Setting;
